/* eslint-disable react/jsx-filename-extension */
import { React } from 'react';
import {
  StyleSheet, Text, View, Button,
} from 'react-native';

const styles = StyleSheet.create({
  list: {
    padding: 10,
    fontSize: 18,
    height: 44,
  },
  goodJob: {
    fontSize: 32,
    textAlign: 'center',
    marginTop: 20,
    fontWeight: 'bold',
  },
  cyanRectangle: {
    backgroundColor: 'cyan',
    borderRadius: 20,
    width: 200,
    height: 200,
    marginBottom: 30,
    alignItems: 'center',
    justifyContent: 'center',
  },
  scoreContainer: {
    alignItems: 'center',
    marginTop: 40,
  },
  scoreText: {
    fontWeight: 'bold',
    fontSize: 28,
    textAlign: 'center',
  },
  topTenText: {
    fontSize: 18,
    alignItems: 'center',
    fontWeight: 'bold',
  },
  topTenContainer: {
    alignItems: 'center',
  },
  listContainer: {
    alignItems: 'center',
    marginTop: 10,
  },
});

function Results({ Score, HandleRestart, TopPlayers }) {
  const top = TopPlayers;
  return (
    <View>
      <View>
        <View>
          <Text style={styles.goodJob}>Good Job!</Text>
        </View>
        <View style={styles.scoreContainer}>
          <View style={styles.cyanRectangle}>
            <Text style={styles.scoreText}>
              Score
              {' '}
              {'\n'}
              {Score}
            </Text>
          </View>
        </View>
        <Button title="Restart" onPress={HandleRestart} />
      </View>
      <View>
        <View>
          <View style={styles.topTenContainer}>
            <Text style={styles.topTenText}>
              Top 10
            </Text>
          </View>
          <View style={styles.listContainer}>
            <View>
              { top.map((player) => (
                <Text key={player.user}>
                  { player.user }
                  :
                  {' '}
                  { player.best }
                </Text>
              ))}
            </View>
          </View>
        </View>
      </View>
    </View>
  );
}

export default Results;
